import IMG from "../../images/Inicio.jpg"
import './home.css'




const Home = () => {
    return (
      <div className="div">
        <h1>Bienvenidos Harry's Book</h1>
        <div className="image">
          <img src={IMG} alt="" className="img-main"/>
        </div>
      </div>
    );
  };

  export default Home;
